import PropTypes from "prop-types"
import Header from "./Header"

export default function Page ({children}) {
    return (
        
        <div>
            <Header/>
            {children}
        </div>
    )
}

// adding type checks for props:
Page.propType = {
    children:PropTypes.any,
    cool:PropTypes.string
}
